post_text:
We are so proud to see the first graduates of SWLCA from Lake Charles College Prep. These students entered SWLCA as 6th graders when the doors first opened, now they are strolling the hallways as SENIORS!!!

Continue to make an impact on the world around you as you soar to even higher heights!!! {Rodney Felton, Tyler Gardner, Mya Keitland, Armani Washington}

#SeniorStroll2019

